import React from 'react'

const Sign_up = () => {
    return(
        <>
            <div className="login_title">
                <h3>JOIN US</h3>
                <p>회원가입을 환영합니다.</p>
            </div>
            <div className="sign_up">
                <div className="sign_up_title">
                    <h3>기본 정보</h3>
                    <p>회원가입을 위한 필수입력 항목</p>
                </div>
            </div>
        </>
    );
};

export default Sign_up;
